class Solution {
    int n = -1;
public:
    int shortestPathBinaryMatrix(vector<vector<int>>& grid) {
        if (grid[0][0]) {
            return -1;
        }
        n = grid.size();
        using RowCol = std::pair<int, int>;
        std::queue<RowCol> queue;
        queue.push(RowCol{0, 0});
        grid[0][0] = 1;
        while (!queue.empty()) {
            auto [row, col] = queue.front(); queue.pop();
            if (row == n-1 && col == n-1) {
                return grid[row][col];
            }
            for (int i = -1; i < 2; ++i) {
                for (int j = -1; j < 2; ++j) {
                    if (on_boundary(row+i, col+j) && grid[row+i][col+j] == 0) {
                        grid[row+i][col+j] = grid[row][col]+1;
                        queue.push(RowCol{row+i, col+j});
                    }
                }
            }
        }
        return -1;
    }

private:
    bool on_boundary(int row, int col) {
        return std::min(row, col) >= 0 && std::max(row, col) < n;
    }
};

// TLE: only because I am saving an extra integer in the queue ::
class Solution {
    int n = -1;
public:
    int shortestPathBinaryMatrix(vector<vector<int>>& grid) {
        if (grid[0][0]) {
            return -1;
        }
        n = grid.size();
        using LengthRowCol = std::tuple<int, int, int>;
        std::queue<LengthRowCol> queue;
        queue.push(LengthRowCol{1, 0, 0});
        while (!queue.empty()) {
            auto [length, row, col] = queue.front(); queue.pop();
            if (row == n-1 && col == n-1) {
                return length;
            }
            grid[row][col] = 1;
            for (int i = -1; i < 2; ++i) {
                for (int j = -1; j < 2; ++j) {
                    if (on_boundary(row+i, col+j) && grid[row+i][col+j] == 0) {
                        queue.push(LengthRowCol{length+1, row+i, col+j});
                    }
                }
            }
        }
        return -1;
    }

private:
    bool on_boundary(int row, int col) {
        return std::min(row, col) >= 0 && std::max(row, col) < n;
    }
};

